class FloatingActionMenuComponent {
    constructor() {
        this.isOpen = false;
        this.state = 'closed';
        this.toggle = 'click';
    }
    /**
     * @return {?}
     */
    clicked() {
        if (this.toggle !== 'click') {
            return false;
        }
        this.isOpen = !this.isOpen;
        if (this.isOpen) {
            this.state = 'open';
        }
        else {
            this.state = 'closed';
        }
    }
    /**
     * @return {?}
     */
    entered() {
        if (this.toggle !== 'hover') {
            return false;
        }
        this.state = 'open';
    }
    /**
     * @return {?}
     */
    leaved() {
        if (this.toggle !== 'hover') {
            return false;
        }
        this.state = 'closed';
    }
    /**
     * @return {?}
     */
    ngOnInit() { }
}
